import React from 'react';
import SHOP_DATA from './shop.data';


class ShopPage extends Component {
    constructor(props) {
        super(props);
        this.state = {
            collection: SHOP_DATA
        }
    }
    render() {
        return (
            <div className='shop-page'>
                SHOP PAGE
            </div>
        );
    }
}

export default ShopPage;
